import { SegnalazioniProvider } from './SegnalazioniContext'; 

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <SegnalazioniProvider> 
      <App />
    </SegnalazioniProvider>
  </React.StrictMode>
);


reportWebVitals();
